import React from 'react';
import { useNavigate } from 'react-router-dom';  // Import useNavigate hook
import './Home.css';

const Home = () => {
  const navigate = useNavigate();  // Initialize the navigation hook

  const handleLoginClick = () => {
    navigate('/login');  // Navigate to the login page when the Login button is clicked
  };

  const handleSignupClick = () => {
    navigate('/signup');  // Navigate to the signup page when the Signup button is clicked
  };

  return (
    <div className="page-wrapper">
      {/* White top section with heading */}
      <div className="top-white-space">
        <h1 className="home-title">Welcome to Student Enrollment Portal</h1>
      </div>

      {/* Background image section */}
      <div className="home-container">
        <header className="home-header">
          <div className="button-group">
            <button className="nav-button" onClick={handleLoginClick}>
              Login
            </button>
            <button className="nav-button" onClick={handleSignupClick}>
              Signup
            </button>
          </div>
        </header>
      </div>
    </div>
  );
};

export default Home;
